import { MDBContainer } from 'mdb-react-ui-kit'
import React from 'react';
import Story from './Story';

export default function Storys(){
  return(
    <MDBContainer className='d-inline-flex border bg-white rounded-2' style={{maxWidth:'70vh'}}>
      <Story/>
      <Story/>
    </MDBContainer>
  );
}
